import React, { Component } from 'react';

import Container from '../Container';
import * as C from './style';

class Cell extends Component {
  render() {
    const { id, children } = this.props;

    return (
      <C.Wrapper id={id} className="cell">
        {children && (
          <Container
            children={children}
            // direction={direction}
          />
        )}
        {/* {JSON.stringify(children)} */}
      </C.Wrapper>
    );
  }
}

export default Cell;
